import Contact from './Components/contact';

export default function App() {
  return (
    <div className="App">
      <div class="container">
        <input class="label-check" id="label-check" type="checkbox"></input>
          <label for="label-check" class="hamburger-label">
            <div class="line1"></div>
            <div class="line2"></div>
            <div class="line3"></div>
            <label></label></label></div>      <div className="header">
        <Header />
        <div className='main'>
          <Main />
          <div className='about'>
            <About />
            <div className='portfolio'>
              <Portfolio />
              <div className='resume'>
                <Resume />
              </div>
              <div className='contact'>
                <Contact />
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>

  );
}
